import './Header.css';
import UploadPage from '../pages/UploadPage';

function Header(){
    return(
            <header>
            <UploadPage/>
            <h1 className="header-title">Image Annotation and Measurement Application!</h1>
            <img className="header-logo" alt="logoImage" src="https://thenounproject.com/api/private/icons/1396339/edit/?backgroundShape=SQUARE&backgroundShapeColor=%23000000&backgroundShapeOpacity=0&exportSize=752&flipX=false&flipY=false&foregroundColor=%23000000&foregroundOpacity=1&imageFormat=png&rotation=0"/>
            </header>
    );
}
export default Header;
